    <Table stickyHeader size="small">
      <TableHead>
         <TableRow>
               {columns.map(column => (
           <TableCell key={column} className={classes.cell}>
             <Typography variant="h6">{column}</Typography>
           </TableCell>
               ))}
         </TableRow>
      </TableHead>
      <TableBody>
        {(ROWS_PER_PAGE > 0 ? data.slice(
          (Number(pageNumber) - 1) * ROWS_PER_PAGE,
     (Number(pageNumber) - 1) * ROWS_PER_PAGE + ROWS_PER_PAGE,):        data).map(dataRow => {
         return (
            <TableRow key={dataRow.id}
               classes={{ hover: classes.hover }} hover>
               <TableCell className={classes.tableCell}>
                   {dataRow.first_name}
               </TableCell>
               <TableCell align="left">
                   {dataRow.last_name}
               </TableCell>
             </TableRow>
            );
          })}
     </TableBody>
  </Table>
</TableContainer>
);
